import React from 'react';

const ExpenseSelect = () => {
    return (
        <div>
            <select>
                <option value={2019}>2019</option>
                <option value={2020}>2020</option>
                <option>2021</option>
                <option>2022</option>
            </select>
        </div>
    )
}

export default ExpenseSelect;
